import React, { useEffect, StrictMode } from "react";
import { createRoot } from "react-dom/client";
import "./styles.css";

import App from "./App";


useEffect(() => {
  document.title = "new title"
}, []);
const root = createRoot(document.getElementById("root"));
root.render(
  <StrictMode>

    <App />
  </StrictMode>
);
